import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';
import markerIcon from 'leaflet/dist/images/marker-icon.png';
import markerShadow from 'leaflet/dist/images/marker-shadow.png';

// Set up the default icon
L.Marker.prototype.options.icon = L.icon({
    iconUrl: markerIcon,
    shadowUrl: markerShadow,
    iconSize: [25, 41],
    iconAnchor: [12, 41],
    popupAnchor: [1, -34],
    shadowSize: [41, 41],
});

const center = [-37.8136, 144.9631]; // Melbourne's approximate center

function MarketAnalysis() {
    const [highSalesSuburbs, setHighSalesSuburbs] = useState([]);

    useEffect(() => {
        async function fetchData() {
            try {
                const response = await fetch('/highSalesSuburbData.json'); 
                if (!response.ok) {
                    throw new Error(`HTTP error! Status: ${response.status}`);
                }
                const suburbData = await response.json();
                setHighSalesSuburbs(suburbData);
            } catch (error) {
                console.error("Failed to fetch suburb data:", error);
            }
        }
        fetchData();
    }, []);

    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
            <div style={{ width: '80%', maxWidth: '600px', textAlign: 'center' }}>
                <h1>Market Analysis</h1>
                <MapContainer center={center} zoom={12} style={{ height: '400px', width: '100%', borderRadius: '8px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)' }}>
                    <TileLayer
                        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                        attribution="&copy; <a href='https://www.openstreetmap.org/copyright'>OpenStreetMap</a> contributors"
                    />
                    {highSalesSuburbs.map((suburb, index) => (
                        <Marker
                            key={index}
                            position={[suburb.coordinates.lat, suburb.coordinates.lng]}
                        >
                            <Popup>
                                <strong>{suburb.suburb}</strong><br />
                                Average Price: ${suburb.average_price.toLocaleString()}
                            </Popup>
                        </Marker>
                    ))}
                </MapContainer>
            </div>
        </div>
    );
}

export default MarketAnalysis;
